import React from 'react'
import PropTypes from 'prop-types';
import Card from '@mui/material/Card';
import CardHeader from '@mui/material/CardHeader';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Avatar from '@mui/material/Avatar';
import Typography from '@mui/material/Typography';
import IconButton from '@mui/material/IconButton';
import MoreVertIcon from '@mui/icons-material/MoreVert';
import Skeleton from '@mui/material/Skeleton';


function Cart() {
  
  
  const handlelogout=async()=>{
    const result=await(await fetch("http://localhost:9000/rest/logout",{
      method:"POST",
      credentials:"include"
    })).json()
    
    console.log(result);
    // .then(res=>console.log(res.json()))
    // .then(a=>console.log(a))
    localStorage.setItem("token","")
     }
  return (
   <>
   <div className="head container">

   
<img src='https://mir-s3-cdn-cf.behance.net/projects/404/2971a3169377049.Y3JvcCwxMDgwLDg0NCwwLDExNw.png' style={{width:"190px",height:"160px",marginTop:"-40px"}} />

 {/* {localStorage.getItem("token")&&<h4>Welcome {((JSON.parse(localStorage.getItem("token"))).email)} {console.log((JSON.parse(localStorage.getItem("token"))).email)} </h4>
} */}

<ul className="list"> 
{/* <li><a href="/cart"><i class="fa fa-shopping-cart" aria-hidden="true"></i></a></li> */}
   <li><a href="/" onClick={handlelogout} >Logout</a></li>
   
   </ul>
</div>

<h3 style={{color:"red",fontStyle:"oblique"}}>Get What You Eye</h3>


<Stack spacing={1}>
      {/* For variant="text", adjust the height via font-size */}
      <Skeleton variant="text" sx={{ fontSize: '1rem' }} />

      {/* For other variants, adjust the size with `width` and `height` */}
      <Skeleton variant="circular" width={40} height={40} />
      <Skeleton variant="rectangular" width={210} height={60} />
      <Skeleton variant="rounded" width={210} height={60} />
    </Stack>

   </>
  )
}

export default Cart
